        currency: "KRW",
        CPV: null,
        title: "17319\ud68c. \uc5b4\uba38\ub2c8\uac00 \ubcf4\ud5d8\uc0ac\uae30\uc5d0 \ub2f9\ud558\uc2e0\uac70 \uac19\ub2e4\uace0 \ud558\ub294\ub370, \uc798 \ubaa8\ub974\uaca0\uc2b5\ub2c8\ub2e4",
        description:
            "DB\uc190\ud574\ubcf4\ud5d8 \ud55c\ubb38\ucca0\uc758 \ucd08\uae30\ub300\uc751\ud50c\ub79c\n\uc804\ud654\uc0c1\ub2f4\uc2e0\uccad 1644-0070\n\uc628\ub77c\uc778\uc0c1\ub2f4\uc2e0\uccad http://m.site.naver.com/11FYh\n\uc900\ubc95\uac10\uc2dc\uc778\ud655\uc778\ud544 \uc81c2022-4859\ud638(2022.09.29)\n\n\n39362\n221021 (\uae08) 2\ubd80 \uc0dd\ubc29\uc1a1\n\ubc1c\uc774 \ub07c\uc5c8\ub2e4\uace0 \ucc28\ub97c \ube7c\ub77c\uace0 \ud558\ub294\ub370...\n\n\uc57c\uac04\uc5d0 \ube14\ubc15\ucc28\uac00 \ub3c4\ub85c \uac00\uc7a5\uc790\ub9ac\ub85c \uc8fc\ud589\ud558\ub294\ub370, \ub9c8\uc8fc \uac78\uc5b4\uc624\ub358 \ubcf4\ud589\uc790\uac00 \ucc28 \ubc14\ud034\uc5d0 \ubc1c\uc774 \ub07c\uc5c8\ub2e4\uace0 \ud558\ub294 \uc0c1\ud669. \n\n\n\uc5b4\uba38\ub2c8\uac00 \ubcf4\ud5d8\uc0ac\uae30\uc5d0 \ub2f9\ud558\uc2e0\uac70 \uac19\uc2b5\ub2c8\ub2e4\n\n\n\n2022\ub144 10\uc6d4 17\uc77c 22\uc2dc\uacbd (\uc6d4)\n\uacbd\uae30\ub3c4 \uace0\uc591\uc2dc \uc77c\uc0b0\ub3d9\uad6c\n\n\n\n\uc5b4\uba38\ub2c8\uac00 \ub108\ubb34 \uc5b4\ub450\uc6b4 \uacf3\uc5d0\uc11c (\ube14\ubc15\uc5d0\uc120 \uc798 \ubcf4\uc785\ub2c8\ub2e4...)\n\n\n\uc778\ub3c4 \uc5c6\ub294 \ucc28\ub3c4\uc5d0\uc11c \uc0ac\ub78c\uc774 \ucc28 \ucabd\uc73c\ub85c \uc624\uba74\uc11c \ub180\ub77c\uc11c \uc815\uac70\ub97c \ud558\uc600\ub294\ub370 \uc815\ud669\uc0c1 \ubc1c\uc774 \ub084 \uc218 \uc5c6\ub294\ub370 \ubc1c\uc774 \ub07c\uc5c8\ub2e4\uba70 \uacc4\uc18d \ud6c4\uc9c4\uc744 \ud558\ub77c\uace0 \ud558\uc9c0\ub9cc \uc5b4\uba38\ub2c8\ub294 \ubcf4\ud5d8\uc0ac\uae30 \uac19\ub2e4\uace0 \uc0dd\uac01\ud558\uba70 \ud6c4\uc9c4\ud558\uc9c0 \uc54a\uc558\uc9c0\ub9cc \uc0c1\ub300\ubc29\uc740 \ubc1c\uc774 \uacc4\uc18d \ub07c\uc5b4 \uc788\ub2e4\uba70 \uc751\uae09\uc2e4\uc5d0 \uac14\uc2b5\ub2c8\ub2e4.\n\n\n\ub2f9\uc2dc \ucd9c\ub3d9\ud55c \uacbd\ucc30\uc740 \uc81c\uac00 \ud310\ub2e8\ud560 \uc218\ub294 \uc5c6\ub294 \uac70\uc9c0\ub9cc \ubcf4\ud5d8\uc0ac\uae30\ub77c\uace0 \ub9d0\ud558\uc2e4 \ub9cc\ud07c \uc5b4\uba38\ub2c8\uaed8\uc11c \ub108\ubb34 \uc5b5\uc6b8 \ud558\uc2e4\ub9cc\ud558\ub2e4 \ub77c\uace0\uae4c\uc9c0 \ud558\uc168\uace0\n\n\n\ub2f4\ub2f9\uc218\uc0ac\uad00\uc740 \uc5f0\uc138\ub3c4 \uc788\uc73c\uc2dc\uace0 \ub180\ub77c\uc168\uaca0\uc9c0\ub9cc \uc544\ubb34\ub9ac \uadf8\ub798\ub3c4 \uacfc\uc2e4\uc774 \uc544\uc8fc \uc870\uae08\uc774\ub77c\ub3c4 \uc7a1\ud788\uba74 \ubcf4\ud5d8\uae08 \uc9c0\uae09\uc740 \uc5b4\uca54 \uc218 \uc5c6\ub2e4\uace0\ub9cc \ud569\ub2c8\ub2e4...\n\n\n\uc800\ud76c \uc5b4\uba38\ub2c8\uac00 \uc5f0\uc138\uac00 \ub9ce\uc73c\uc2e0\ub370....\n\n\uc774\ub7f0 \uc77c \ub2f9\ud55c \uac70\uc5d0 \ub108\ubb34 \ud654\uac00 \ub0a9\ub2c8\ub2e4...\n\n\n\n\uc800\ud76c\uac00 \uc870\uce58\ud560 \uc218 \uc788\ub294 \uac8c \uc5b4\ub5a4 \uac8c \uc788\uc744\uae4c\uc694...?\n\n\uc7ac\uc870\uc0ac \uc694\uccad\ud574\ub3c4 \uc800\ud76c\uac00 \uacfc\uc2e4\uc774 \uc7a1\ud790\uae4c\uc694?\n\n\ubc94\uce59\uae08 \uac70\ubd80\ud558\uac8c \ub41c\ub2e4\uba74 \ubd88\uc774\uc775\uc774 \uc788\uc744\uae4c\uc694?\n\n\n\n\n\ud55c\ubb38\ucca0 \ubcc0\ud638\uc0ac\u00a0 \u00a0 2022-10-20 13:08\n\ubcf4\ud589\uc790\uc5d0\uac8c \ube75~ \ud574 \uc92c\ub098\uc694?\n\n\n\ub2e4\ub9ac \ubd80\ub52a\uce5c \uac8c \uc544\ub2c8\uace0 \ubc1c\uc774 \ubc14\ud034\uc5d0 \ub07c\uc600\ub2e4\uace0 \ud558\ub098\uc694?\n\n\n\n\n\ucc28\uac00 \uba3c\uc800 \uba48\ucdc4\ub098\uc694?\n\n\uc544\ub2c8\uba74 \ubcf4\ud589\uc790\uc640 \ubd80\ub52a\uce58\uba74\uc11c \uba48\ucdc4\ub098\uc694?\n\n\n\n\n\ud55c\ubb38\ucca0 \ubcc0\ud638\uc0ac\u00a0 \u00a0 2022-10-20 13:09\n\ubcf4\ud589\uc790\ub294 \ubaa8\uc790 \uc4f0\uace0 \uace0\uac1c \uc219\uc778 \ucc44 \uacc4\uc18d \uac78\uc5b4\uc628 \uac74\uac00\uc694?\n\n\n\ubcf4\ud589\uc790\ub294 \uc220\uc5d0 \ucde8\ud574 \uc788\uc5c8\ub098\uc694?\n\n\n\nman****\u00a0 \u00a0 2022-10-20 15:01\n\uc5f0\uc138\uac00 \uaf64 \uc788\uc73c\uc154\uc11c \ub108\ubb34 \ub180\ub77c\uc154\uc11c \uacbd\uc801\uc740 \uc6b8\ub9ac\uc9c0 \ubabb\ud558\uc168\uc2b5\ub2c8\ub2e4.\n\n\n\ub2e4\ub9ac\uac00 \uc544\ub2cc \ubc1c\uc774 \ub07c\uc5c8\ub2e4\uace0 \uacc4\uc18d \ud6c4\uc9c4\ud558\ub77c\uace0 \ud588\ub294\ub370 \uc5b4\uba38\ub2c8\ub294 \ubb54\uac00 \uc774\uc0c1\ud558\ub2e4\uace0 \uc0dd\uac01\ud558\uc154\uc11c \ud6c4\uc9c4\ud558\uc9c0 \uc54a\uc73c\uc168\ub2e4\uace0 \ud569\ub2c8\ub2e4.\n\n\n\uadf8\ub9ac\uace0 \uc800 \uc0ac\ub78c\uc740 \uc0ac\uc9c4\ubd80\ud130 \ucc0d\uc5c8\uace0\uc694.\u00a0 \uc544\ud508 \uc0ac\ub78c \uac19\uc9c0 \uc54a\uc558\ub2e4\uace0 \ud569\ub2c8\ub2e4.\n\n\n\uacbd\ucc30\uc774 \uc62c \ub54c\uae4c\uc9c0 \ubc1c\uc744 \ub123\uc5b4 \ub193\uc558\ub294\uc9c0...\n\n\uc774\uc0c1\ud55c \uc810\uc740 \uacbd\ucc30\uc740 \uc640\uc11c \uc804\uc9c4\uc73c\ub85c \ucc28\ub97c \ube7c\ub2ec\ub77c\uace0 \ud558\uc600\uc2b5\ub2c8\ub2e4.\n\n\n\uc5b4\uba38\ub2c8\uaed8\uc11c \uc815\uac70\ud558\uc168\uc73c\ub098 \ubc94\ud37c \ucabd\uc73c\ub85c \ub611\uac19\uc740 \ud0c0\uc774\ubc0d\uc5d0 \ub2e4\uac00\uc640\uc11c \ub2ff\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\n\n\n\n\ubcf4\ud589\uc790\ub294 \uc220\uc5d0 \ucde8\ud574 \uc788\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4.\n\n\n\n\ud55c\ubb38\ucca0 \ubcc0\ud638\uc0ac\u00a0 \u00a0 2022-10-21 07:41\n\uacbd\ucc30\uc774 \uc62c \ub54c\uae4c\uc9c0 \uc2dc\uac04\uc740 \uc5bc\ub9c8\ub098 \uac78\ub838\ub098\uc694?\n\n\n\uc870\uc218\uc11d \uc55e\ubc14\ud034\uc5d0 \ubc1c\uc774 \ub07c\uc5c8\ub2e4\uace0 \ud588\ub098\uc694?\n\n\n\uc5b4\uba38\ub2c8\ub294 \uacbd\ucc30 \uc62c \ub54c\uae4c\uc9c0 \ucc28\uc5d0\uc11c \uc548 \ub0b4\ub9ac\uc168\ub098\uc694?\n    \n\n\n\n* \uc758\uacac *\n\n- \ubc1c\uc774 \uc815\ub9d0 \ub07c\uc5c8\ub294\uc9c0 \uc601\uc0c1\ub9cc \ubcf4\uace0\ub294 \ud30c\uc545\ud558\uae30 \uc27d\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n- \ubcd1\uc6d0\uc5d0\uc11c \ubd80\uc0c1 \uc815\ub3c4\ub97c \ud30c\uc545\ud558\uac70\ub098 \uacbd\ucc30\uc774 \uc0c1\ub300\uc758 \uc2e0\ubc1c \ub4f1\uc744 \ud655\uc778\ud558\uba74 \ub420 \uac83 \uac19\uc740\ub370, \ucd08\ub3d9 \uc218\uc0ac\uac00 \uc81c\ub300\ub85c \ub418\uc5c8\uc744\uc9c0 \uc758\ubb38\uc785\ub2c8\ub2e4.\n- \uc0c1\ub300\ub97c \ubc1c\uacac\ud558\uace0 \ubbf8\ub9ac \uba48\ucdc4\ub2e4\uba74 \uc5b4\ub560\uc744\uae4c \ud558\ub294 \uc758\uacac\uc785\ub2c8\ub2e4.\n\n\n\n\n\ubc30PD, #\ud55c\ubb38\ucca0 #\ud55c\ubb38\ucca0TV #\ube14\ub799\ubc15\uc2a4 #\ube14\ubc15\uc601\uc0c1 #\uad50\ud1b5\uc0ac\uace0 #\uad50\ud1b5\uc0ac\uace0\uc601\uc0c1 #traffic #accident #trafficaccident #car #caraccident #dashcam #blackbox",
